Ext.data.JsonP['ACS_2013_26_September_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>26 September 2013</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-50725346\" class=\"content\">\n                        <h1>26 September 2013</h1>\n    <p>This update includes the following bug fixes and enhancements:    </p>\n<ul class=\" \"><li class=\" \">    <p>The query methods support two new parameters: <tt class=\" \">sel</tt> and <tt class=\" \">unsel</tt>. Use these parameters to specify which fields to return or not to return. You cannot use these parameters together.    </p>\n</li><li class=\" \">    <p>Website: Added new feature to unsubscribe devices from push notifications using the ACS web console    </p>\n</li><li class=\" \">    <p>Fixed an issue where the <tt class=\" \">$inc</tt> operation was not auto-incrementing a custom field    </p>\n</li></ul>        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=50725346\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"ACS 2013 26 September Release Note"});